import "./App.css";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import Home from "./components/Home";
import About from "./components/About";
import ContactUs from "./components/ContactUs";

function App() {
  return (
      <div>
      <>
        <Router>
          <Routes>
            <Route
                path="/"
                element={<Home /> }
            />
            <Route
                path="/about"
                element={<About />}
            />
            <Route
                path="/contactus"
                element={<ContactUs />}
            />
            <Route
                path="*"
                element={<Navigate to="/" /> }
            />
          </Routes>
        </Router>
      </>
        <footer>
          <div className={"wrapper"}>
            <label className={"label"}> Контакты:</label>
            <label className={"labelContact"}> Телефон: 8-999-345-21-45</label>
            <label className={"labelMail"}> Почта: pxutornayaaa@gmail.ru</label>
            <a href={' https://nicepage.com/ru/k/ресторан-shablony-veb-saytov'} className={"labelHref"}> Связаться со мной</a>
          </div>
        </footer>
      </div>
  );
}

export default App;
